import React from 'react';
import Tribe from './assets/Tribe.png'
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';
import Assignment1 from './Assignment1';
import Link from '@mui/material/Link';



const Index = () => {
  return( 
    <>   
        <Grid container sm={12} padding={5}>
            <Grid item sm={4}  container justifyContent='center'>
                <img src={Tribe} alt='tribe' />
            </Grid>
            <Grid item sm={4} container justifyContent='center'>
                <Link to="test1" spy={true} smooth={true} offset={50} duration={500}>
                    <Button variant='outlined' size='small' sx={{color: 'white', background: '#3C0D99'}}>Assignment 1</Button>
                </Link>
            </Grid>
            <Grid item sm={4} container justifyContent='center'>
                <Button variant='outlined' size='small' sx={{color: 'white', background: '#3C0D99'}}>Assignment 2</Button>
            </Grid>
            <Assignment1 name='test1' />
        </Grid>
    </>
    )
};

export default Index;
